import React from "react";

class Settlement extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      participants: this.props.participants,
      paymentsList: [],
      transactions: []
    };
  }

  componentDidMount() {}

  render() {
    return <div>test</div>;
  }
}

export default Settlement;
